SET sql_mode='NO_BACKSLASH_ESCAPES';
CREATE TABLE `teams` ( `id` INTEGER AUTO_INCREMENT PRIMARY KEY AUTO_INCREMENT  ,`name` TEXT   );
CREATE TABLE `tournaments` ( `id` INTEGER AUTO_INCREMENT PRIMARY KEY AUTO_INCREMENT  ,`name` TEXT   );
CREATE TABLE `maps` ( `id` INTEGER AUTO_INCREMENT PRIMARY KEY AUTO_INCREMENT  ,`name` TEXT   );
CREATE TABLE `scores` ( id INTEGER AUTO_INCREMENT PRIMARY KEY AUTO_INCREMENT , `match` TEXT, `map` TEXT, `team1_score` TEXT, `team2_score` TEXT);
CREATE TABLE `matches` ( `id` INTEGER AUTO_INCREMENT PRIMARY KEY AUTO_INCREMENT  ,`hltvid` TEXT,`date` TEXT,`team1` TEXT,`team2` TEXT,`link` TEXT,`tournament` TEXT,`bestof` TEXT   );
CREATE UNIQUE INDEX UQ_teamsid ON `teams` (`id`);
CREATE UNIQUE INDEX UQ_tournamentsname ON `tournaments` (`name`);
CREATE UNIQUE INDEX UQ_mapsname ON `maps` (`name`);
CREATE UNIQUE INDEX UQ_matcheshltvid ON `matches` (`hltvid`);
